This will work the first time. But if you go and change the return to "b" and then saved the class, the VE doesn't realize that Indirector is a changed class that it is interested in so it won't recycle. You will still see if return "a". The only way to get it to return "b" is to close the VE and reopen it to get the  latest code through a new vm.

