My hunch is that AJDT is confused because I have that continue and no additonal code for what happens when the if evaluates false.

In fact, changing the method to its final form:
    @SuppressNullCheck
    public Collection<String> findServiceIdsForInterface(Class serviceInterface, Module module)
    {
        notNull(serviceInterface, "serviceInterface");

        List<String> result = CollectionFactory.newList();

        for (String id : _moduleDef.getServiceIds())
        {
            ServiceDef def = _moduleDef.getServiceDef(id);

            if (def.getServiceInterface() != serviceInterface)
                continue;

            if (notVisible(def, module))
                continue;

            result.add(id);
        }

        return result;
    }

Also eliminates the popup exception from AJDT.  So this looks like some kind of flow analysis error.

